import React from "react";
import styled from "styled-components";

const Box = styled.div`
    width: 400px;
    min-width: 400px;
    height: 240px;
    background-color: #999;
    margin: 40px;

    border-radius: 7px;
    box-shadow: 2px 2px 4px #999;

    padding: 5px;

    display: flex;
    flex-direction: row;
`;

const PosterDiv = styled.div`
    width: 120px;
    height: 100%;
    background-image: url("https://i.pinimg.com/474x/73/c0/14/73c014968fb1223ff9974519c7bf0393.jpg");
`;

const ContentDiv = styled.div`
    width: calc(100% - 200px);
    height: 100%;
`;

const MovieBox = () => {
    return (
        <Box>
            <PosterDiv>PosterDiv</PosterDiv>
            <ContentDiv>ContentDiv</ContentDiv>
        </Box>
    )
};

export default MovieBox;
